import { useState } from "react";
import {Link,useNavigate} from 'react-router-dom';
import axios from 'axios';

function Register() {
 let [username,setUSername]=useState("");
 let [password,setPassword]=useState("");
 let [firstname,setfirstname]=useState("");
 let [lastname,setlastname]=useState("");
 let [contactnumber,setcontactnumber]=useState("");

 let [user, setValues] = useState({
  username: "",
  password: "",
  firstname: "",
  lastname: "",
  contactnumber: ""
});

const [errorMsg, setErrorMsg] = useState("");
const [successMsg, setSuccessMsg] = useState("");


let navigate = useNavigate();
let handleSubmission=async (event)=> {
    event.preventDefault();
    let values = {"username":user.username,"password":user.password,"firstname":user.firstname,"lastname":user.lastname,"contactnumber":user.contactnumber};
    console.log(values);
    try{
    let result = await axios.post("http://localhost:8081/user/signup",values);
    //console.log(result.data);
    if(result.data=="User Created"){
      setSuccessMsg("Registration done successfully!");
      setTimeout(() => {
        setSuccessMsg("");
        navigate("/register");
      }, 3000);


    }else  {
      setErrorMsg(" User is already created!");
      setTimeout(() => {
        setErrorMsg("");
        navigate("/register");
      }, 3000);


    }
    }catch(ex){
        console.log(ex);
    }
}
return (
    <>
      <div className="d-flex h-100">
        <div className="card container col-10 col-sm-10 col-md-9 col-lg-8 mt-2 p-0 align-self-center border-success">
          <div className="card-header border-dark">
            <div className="mt-2 text-center">
              <h3>MediCare</h3>
              <h4>Register</h4>
            </div>
          </div>
          <div className="card-body">
            <div className="container align-self-center">

              <div className="form-group">
                <label htmlFor="exampleInputEmail1">Email Address</label>
                <input
                  type="email"
                  className="form-control"
                  id="username"
                  value={user.username}
                  aria-describedby="emailHelp"
                  placeholder="Email Address"
                  onChange={(event) =>
                    setValues((prev) => ({ ...prev, username: event.target.value }))
                  }
                />
              </div>
              <div className="form-group">
                <label htmlFor="exampleInputPassword1">Password</label>
                <input
                  type="password"
                  className="form-control"
                  id="password"
                  value={user.password}
                  placeholder="Password"
                  onChange={(event) =>
                    setValues((prev) => ({ ...prev, password: event.target.value }))
                  }
                />
              </div>
			   <div className="form-group">
                <label htmlFor="name">First Name</label>
                <input
                  type="text"
                  className="form-control"
                  id="firstname"
                  value={user.firstname}
                  placeholder="First Name"
                  onChange={(event) => setValues((prev) => ({ ...prev, firstname: event.target.value }))}
                />
              </div>

			   <div className="form-group">
                <label htmlFor="name">Last Name</label>
                <input
                  type="text"
                  className="form-control"
                  id="lastname"
                  value={user.lastname}
                  placeholder="Last Name"
                  onChange={(event) => setValues((prev) => ({ ...prev, lastname: event.target.value }))}
                />
              </div>
			   <div className="form-group">
                <label htmlFor="name">Contact Number</label>
                <input
                  type="text"
                  className="form-control"
                  id="contactnumber"
                  value={contactnumber.lastname}
                  placeholder="Contact Number"
                  onChange={(event) =>setValues((prev) => ({ ...prev, contactnumber: event.target.value }))
                }
                />
              </div>

              <div className="text-center text-danger">{errorMsg}</div>
              <div className="text-center text-success">{successMsg}</div>
              <div className="form-group mt-4">
                <button
                  type="submit"
                  onClick={handleSubmission}
                  className="btn btn-success btn-block">
                  Register
                </button>
              </div>
              <div className="form-group text-center">
                Already have an account? <Link to="/login">Login here!</Link>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
                }
export default Register;
